ge at confirmpassword on Register Page as \"Please fill out this field.\"\r\n\r\n  Scenario Outline: To verify Register Form with invalid credentials\r\n    Given The user opens Register Page\r\n    When User enter \"<username>\" ,\"<password>\" and \"<confirmpass>\"\r\n    Then User click Register and verify the \"<message>\"\r\n\r\n    Examples: \r\n      | username  | password   | confirmpass  | message                                                 |\r\n      | numpy84$3 | ninja      | ninja        | password_mismatch:The two password fields didn’t match. |\r\n      | numpy     | automation | automation84 | password_mismatch:The two password fields didn’t match. |\r\n      | numpy     |  123456789 |    123456789 | password_mismatch:The two password fields didn’t match. |\r\n      | numpy     | ninja5     | ninja5       | password_mismatch:The two password fields didn’t match. |\r\n\r\n  Scenario Outline: to register with all the data\r\n    Given The user opens Register Page\r\n    When user enter the sheetname \"<sheetname>\" and row number <rownum>\r\n    Then user click on Register button and verify message as \"password_mismatch:The two password fields didn’t match.\"\r\n\r\n    Examples: \r\n      | sheetname | rownum |\r\n      | Register  |      0 |\r\n      | Register  |      1 |\r\n      | Register  |      2 |\r\n      | Register  |      3 |\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Eclipse/Fenisha/Ds-algo/src/test/resources/Features/TC02_Register.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"To verify and validate  User  Register Form","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"To verify Register Form with Empty fields","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user opens Register Page","id":"5ba42d5a-b9 ks on Run button \r\n\tThen User should be able to see the output \r\n\tExamples: \r\n\t\t|SheetName\t|\tRowNumber\t|\r\n\t\t|PythonCode\t|\t0\t\t\t|\r\n\t\t\r\n\t#Array05\r\nScenario Outline: Validation of error message for invalid python code in TryEditor page \r\n\tGiven User is on \"Try Editor Page\" after logged in \r\n\tWhen User enters invalid Python code from sheet \"<SheetName>\" and <RowNumber> \r\n\tAnd User clicks on Run button \r\n\tThen User should be able to see error message \r\n\tExamples: \r\n\t\t|SheetName\t|\tRowNumber\t|\r\n\t\t|PythonCode\t|\t1\t\t\t|\r\n\t\t\r\n\t#Array06\r\nScenario: Validation of Arrays Using List link \r\n\tGiven User is on \"Array page\" after logged in \r\n\tWhen User clicks on Arrays Using List link \r\n\tThen User should be redirected to \"Arrays Using List\" page \r\n\t\r\n\t#Array07\r\nScenario: Validation of Try Here button \r\n\tGiven User is on \"Arrays Using List\" after logged in \r\n\tWhen User clicks on \"Try Here\" button in \"Arrays Using List\" \r\n\tThen User should be redirected to a page having an tryEditor with a Run button to test \r\n\t\r\n\t#Array08\r\nScenario Outline: Validation of valid python code in TryEditor page using Arrays Using List \r\n\tGiven User is on \"Try Editor Page\" after logged in \r\n\tWhen User enters valid Python code from sheet \"<SheetName>\" and <RowNumber> \r\n\tAnd User clicks on Run button \r\n\tThen User should be able to see the output \r\n\tExamples: \r\n\t\t|SheetName\t|\tRowNumber\t|\r\n\t\t|PythonCode\t|\t2\t\t\t|\r\n\t\t\r\n\t\r\n\t\r\n\t#Array09\r\nScenario Outline: Validation of invalid python code in TryEditor page for Arrays Using List \r\n\tGiven User is on \"Try Editor Page\" after logged in \r\n\tWhen User enters invalid Python code from sheet \"<SheetName>\" and <RowNumber> \r\n\tAnd User clicks on Run button \r\n\tThen User should be able to see error message in an Alert \r\n\tExamples: \r\n\t\t|SheetName\t|\tRowNumber\t|\r\n\t\t|PythonCode\t|\t3\t\t\t|\r\n\t\t\r\n\t#Array10\r\nScenario: Validation of Basic Operations in Lists link \r\n\tGiven User is on \"Array page\" after logged in \r\n\tWhen User clicks on Basic Operations in Lists link \r\n\tThen User should be redirected to \"Basic Operations in Lists\" page \r\n\t\r\n\t#Array11\r\nScenario Outline: Validation of valid python code in TryEditor page for Basic Operations in Lists \r\n\tGiven User is on \"Try Editor Page\" after logged in \r\n\tWhen User enters valid Python code from sheet \"<SheetName>\" and <RowNumber> \r\n\tAnd User clicks on Run button \r\n\tThen User should be able to see the output \r\n\tExamples: \r\n\t\t|SheetName\t|\tRowNumber\t|\r\n\t\t|PythonCode\t|\t4\t\t\t|\r\n\t\t\r\n\t#Array12\r\nScenario Outline: Validation of invalid python code in TryEditor page for Basic Operations in Lists \r\n\tGiven User is on \"Try Editor Page\" after logged in \r\n\tWhen User enters invalid Python code from sheet \"<SheetName>\" and <RowNumber> \r\n\tAnd User clicks on Run button \r\n\tThen User should be able to see error message in an Alert box \r\n\tExamples: \r\n\t\t|SheetName\t|\tRowNumber\t|\r\n\t\t|PythonCode\t|\t5\t\t\t|\r\n\t\t\r\n\t#Array13\r\nScenario: Validation of Applications of Arrays link \r\n\tGiven User is on \"Array page\" after logged in \r\n\tWhen User clicks on Applications of Array link \r\n\tThen User should be redirected to \"Applications of Array\" page \r\n\t\r\n\t#Array14\r\nScenario Outline: Validation of valid python code in TryEditor page for Applications of Array \r\n\tGiven User is on \"Try Editor Page\" after logged in \r\n\tWhen User enters valid Python code from sheet \"<SheetName>\" and <RowNumber> \r\n\tAnd User clicks on Run button \r\n\tThen User should be able to see the output \r\n\tExamples: \r\n\t\t|SheetName\t|\tRowNumber\t|\r\n\t\t|PythonCode\t|\t6\t\t\t|\t\r\n\t\t\r\n#\t#Array15\r\n#Scenario Outline: Validation of invalid python code in TryEditor page for Applications of Array \r\n#\tGiven User is on \"Try Edito rt message \r\n    \r\n    Scenario: The User navigates to Implementation in stack page\r\n    Given The User is in the \"Stack page\" after logged in\r\n    When The User clicks on the Implementation link\r\n    Then The User should be redirected to the page with title \"Implementation\" \r\n    \r\n    Scenario: The User navigates to tryEditor page from Implementation page\r\n    Given The User is in the \"Stack Implementation page\" after logged in\r\n    When The User clicks Try here button in stack Implementation page\r\n    Then The User should be redirected to the page with title \"tryEditor\"\r\n    \r\n    \r\n    Scenario: The User able to run Python code in tryEditor for Implementation page\r\n    Given The User is in tryEditor page of Stack Implementation\r\n    When The User enter a python code in try Editor\r\n     | print\"Implementation in Stack\" |\r\n    And The User clicks the Run button \r\n    Then The User get the run output \r\n     \r\n    Scenario: The User navigates to Applications in stack page\r\n    Given The User is in the \"Stack page\" after logged in\r\n    When The User clicks on the Applications link\r\n    Then The User should be redirected to the page with title \"Applications\" \r\n\r\n   Scenario: The User navigates to tryEditor page from Applications page\r\n   Given The User is in the \"Application stack page\" after logged in\r\n   When The User clicks Try here button in Applications page\r\n   Then The User should be redirected to the page with title \"tryEditor\"\r\n\r\n   Scenario: The User able to run Python code in tryEditor for Application page\r\n   Given The User is in tryEditor page of Stack Applications\r\n   When The User enter a python code in try Editor\r\n    | print\"Applications in Stack\" |\r\n   And The User clicks the Run button\r\n   Then The User get the run output\r\n    \r\n    Scenario: The User navigates to Practice Questions in stack page\r\n    Given The User is in the \"Stack page\" after logged i
